import React from "react";
import _ from "lodash";
import robot from "../robot.png";

import Image from "react-bootstrap/Image";

function Square(props) {
  const { rowPosition, columnPosition, robotPosition, targetPosition } = props;

  const currentPosition = [rowPosition, columnPosition];

  if (_.isEqual(robotPosition, currentPosition)) {
    return (
      <>
        <td
          style={{ width: "100px", height: "100px" }}
          className="d-flex align-items-center"
        >
          <Image
            src={robot}
            fluid
            className="robot"
            className="text-center"
          ></Image>
        </td>
      </>
    );
  } else if (_.isEqual(targetPosition, currentPosition)) {
    return (
      <>
        <td style={{ width: "100px", height: "100px" }}>Target</td>
      </>
    );
  } else {
    return (
      <>
        <td style={{ width: "100px", height: "100px" }}>Square</td>
      </>
    );
  }
}

export default Square;
